import OutlineButton from "../../components/outlinebutton/outlinebutton";
import styles from "./register.module.css";
import React, {useState, useEffect} from "react";

export default function Register() {
  
  useEffect(() => {
    if(!window) { // if no local storage loaded
      return;
    };
    window.localStorage.setItem("dog", "dalmation")
    console.log(window.localStorage.getItem("dog"));
  }, [email, username]);
  return (
    <div className={styles.mainContainer}>
      <div className={styles.loginContainer}>
        <div className={styles.inputContainer}>
          <div className={styles.headerContainer}>Register</div>
          <input
            onChange={(event) => {
              setEmail(event.target.value);
            }}
            value={email}
            className={styles.inputBox}
            type="text"
            id="email"
            name="email"
            placeholder="Email"
          />
          <input
            value={username}
            className={styles.inputBox}
            type="text"
            id="username"
            name="username"
            placeholder="Username"
          />
          <input
            onChange={(event) => {
              setPassword(event.target.value);
            }}
            value={password}
            className={styles.inputBox}
            type="password"
            id="password"
            name="password"
            placeholder="Password"
          />
        </div>
        <div className={styles.buttonContainer}>
          <OutlineButton title="Register" onClick={() => handleSubmit()}></OutlineButton>
        </div>

      </div>
    </div>
  );
}
